import "./App.css";
import useGoogleCharts from "./useGoogleCharts";
import { Container } from "react-bootstrap";
import PerformanceTimeline from "./PerformanceTimeline";

function App() {
  const google = useGoogleCharts();
    const timelineStyle={
        height: '100%',
    }

  return (
    <>
      <Container className="mt-3" style={timelineStyle}>
        <h1>With Hooks</h1>
        <PerformanceTimeline google={google} filter={[]}/>
      </Container>
    </>
  );
}

export default App;
